(39, 14, NULL, 7, ' Stylish Storage Solution For Lipsticks, Cosmetic Brushes, Eyeliners, And Nail Polishes', 'More Makeup from BuyToday', '73b4aa', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i5.2933pQjSpQjS7d\">Product details of Premium Makeup Organizer - Stylish Storage Solution For Lipsticks, Cosmetic Brushes, Eyeliners, And Nail Polish.</h2>\r\n<p><span>16 Lattices Tabletop Makeup Containers Plastic Lipstick Organizer Storage for Cosmetic Brush/Eyeliner/Nail Polish Makeup Holder.</span></p>', 200, '20230713121033_5fqmS2pg.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'stylish-storage-solution-for-lipsticks-cosmetic-brushes-eyeliners-and-nail-polishes', 1),
(40, 17, NULL, 7, 'Miss Rose Oil Free Waterproof Liquid Concealer 5ml', 'More Makeup from Miss Rose', 'b08d90', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i9.62fff3qTf3qTC1\">Product details of Miss Rose Oil Free Waterproof Liquid Concealer 5ml</h2>\r\n<p>Liquid Foundation Cream Concealer Wand Professional Liquid Face Makeup Foundation Easy to Use Soft 5ml.</p>\r\n<p data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.62fff3qTf3qTC1\">The concealer wand can be applied finely to the face, or in soft light to produce a subtle glowing effect.</p>\r\n<p data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.62fff3qTf3qTC1\">Finally, you can mix concealer foundation with bb to enjoy the shiny and shiny effect of the concealer, while hiding skin blemishes, scars, and acne.</p>\r\n<p><span style=\"font-size: medium; font-family: &acute;arial black&acute;, &acute;avant garde&acute;;\">&nbsp;</span></p>', 350, '20230713010110_3ctu1ywz.png', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'miss-rose-oil-free-waterproof-liquid-concealer-5ml', 2),
(41, 29, NULL, 7, 'UPTOWN LA Oil Free Waterproof Liquid Concealer for Women', 'More Makeup from UPTOWN LA', 'ba840d', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.4eeedytjdytjTS\">Product details of UPTOWN LA Oil Free Waterproof Liquid Concealer for Women</h2>\r\n<ul data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.4eeedytjdytjTS\">\r\n<li>1. Full coverage: UPTOWN LA&acute;s makeup concealer provides full coverage that hides dark circles, blemishes, and imperfections on your skin. It is perfect for those who want a flawless, airbrushed look.</li>\r\n<li>2. Lightweight formula: The concealer has a lightweight formula that blends easily into your skin without feeling heavy or cakey. It provides a natural-looking finish that lasts all day.</li>\r\n<li>3. Brightening effect: UPTOWN LA&acute;s makeup concealer has a brightening effect that instantly gives your skin a more radiant and youthful appearance. It helps to reduce the appearance of fine lines and wrinkles.</li>\r\n<li>4. Long-lasting: The concealer is designed to last all day without smudging or fading, providing you with a flawless finish that stays put.</li>\r\n<li>5. Easy to apply: UPTOWN LA&acute;s makeup concealer is easy to apply, with a smooth and creamy texture that glides on your skin effortlessly. It comes with a convenient applicator that allows for precise application.</li>\r\n</ul>', 199, '20230713011441_7bfnj2y3.jpg', 1, 0, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 1, 'uptown-la-oil-free-waterproof-liquid-concealer-for-women', 3),
(42, 19, NULL, 7, 'Lazy Lips Lipstick Matte Moisturizing Lip Gloss Lip shape Lipstick Long Lasting High-pigment Lipstick', 'More Makeup from ZM Trader', '22f73e', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.7d09kEDckEDc1m\">Product details of Lazy Lips Lipstick Matte Moisturizing Lip Gloss Lip shape Lipstick Long Lasting High-pigment Lipstick</h2>\r\n<p data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.7d09kEDckEDc1m\">100% brand new and high-quality products. The product adopts a flat design that conforms to the shape of the lips, and you can apply beautiful lip makeup with a single squeeze. The operation is simple, and the color is natural and even. The texture is fine and smooth, dumb but not dry, oily but not greasy. Full color, rich color, high color rendering. It is waterproof and sweatproof, and it does not stick to the cup. Make-up is not easy to fall off and can last for a long time. Many colors are available. Small and light, easy to carry.Suitable for various occasions.</p>', 239, '20230713013016_z0dwyn13.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'lazy-lips-lipstick-matte-moisturizing-lip-gloss-lip-shape-lipstick-long-lasting-high-pigment-lipstick', 4),
(43, 20, NULL, 7, 'High Quality Transparent Color Changing Flower Jelly Lipstick', 'More Makeup from Cat Eye', 'b8d638', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i10.6f7d73BW73BW5x\">Product details of High-Quality Transparent Color Changing Flower Jelly Lipstick</h2>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.6f7d73BW73BW5x\">High Quality</li>\r\n<li>Transparent</li>\r\n<li>Color Changing</li>\r\n<li>Flower Jelly Lipstick</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p><span>100% brand new and high quality moisturizing your lips and make you charmingSuitable for professional use and home use.</span></p>\r\n<p><span>Jelly Flower Lipstick has a magical color change, color will change depending on your lip temperature so EVERYONE has your own EXCLUSIVE lip color. This waterproof moisturizing lipstick has a REAL FLOWER in it and contains Vitamins E, Candelilla wax, Jojoba Seed Oil, Squalane, etc frame, natural ingredients make a pleasant smell, safely prevent lip chap, and moist your lip.</span></p>\r\n</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of High-Quality Transparent Color Changing Flower Jelly Lipstick</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">Cat Eye</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">348467664_PK-1777107563</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Texture</span>\r\n<div class=\"html-content key-value\">Glossy</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.6f7d73BW73BW5x\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\">1x color-changing Lipstick</div>\r\n</div>\r\n</div>', 257, '20230713013927_7xm2wfr9.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'high-quality-transparent-color-changing-flower-jelly-lipstick', 5),
(44, 15, NULL, 7, 'Pack of 6-Pearlin Long Lasting Green Lipsticks', 'More Makeup from Pearlin', '9e9f74', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.5327vOM7vOM7Ov\">Product details of Pack of 6-Pearlin Long Lasting Green Lipsticks</h2>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>12 hours Long Stay</li>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.5327vOM7vOM7Ov\">Comfortable matte finish</li>\r\n<li>In Built Primer, the Texture is: Cream</li>\r\n<li>Smooth and comfortable application</li>\r\n<li>Vitamins A and E included</li>\r\n<li>Intense matte finish with a vibrant color payoff</li>\r\n<li>6 pieces in a package</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p><span>No more looking everywhere for your lipsticks! Now you can finally find it and keep it in one place and at arm&rsquo;s length. Premium quality lipsticks with smoothing primer and matte finish. Contains a variety of </span></p>\r\n<p><span>nourishing and moisturizing ingredients, immediately moisturizing, Rich in glittering factor, let beautiful lips reflect the diamonds shine in a different light, with your lips suddenly full stereo. </span></p>\r\n<p><span>So what are you waiting for? place an order of these lipsticks and get this deal at your doorstep as soon as possible!</span></p>\r\n</div>\r\n<div class=\"pdp-mod-specification\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.5327vOM7vOM7Ov\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of Pack of 6-Pearlin Long Lasting Green Lipsticks</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">Pearlin</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">163128004_PK-1330408336</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Texture</span>\r\n<div class=\"html-content key-value\">Cream</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\">1 &times; 6 pieces of green lipstick</div>\r\n</div>\r\n</div>', 248, '20230713014835_0gh91cmw.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'pack-of-6-pearlin-long-lasting-green-lipsticks', 6),
(45, 21, NULL, 8, 'Nexton- Sunblock Lotion- 30ml', 'More Skin Care from Nexton', '392506', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i7.3923OlEsOlEssI\">Product details of Nexton- Sunblock Lotion- 30ml</h2>\r\n<p>Oil Free, Non-greasy &amp; waterproof</p>\r\n<p>UVA &amp; UVB Protection</p>\r\n<p>24h Ultra Hydration</p>\r\n<div><span>Nexton sunblock lotion has a quickly absorbed formula that protects your skin from sun damage and offers deep, long-lasting moisture. It takes care of your skin better than anything else.</span></div>\r\n<div data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.3923OlEsOlEssI\"><span>It protects your skin from UVA/UVB Rays. It moisturizes your skin and keeps the side effect of heat and pollution and protects your skin from dark circles, dullness, and dryness. It acts as a shield from dirt and debris. With regular use, your skin feels younger, nourished, and glowing.</span></div>', 175, '20230714082021_8fbu7z40.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'nexton-sunblock-lotion-30ml', 1),
(46, 22, NULL, 8, 'Saeed Ghani Foot & Hand Cream (180gm)', 'More Skin Care from Saeed Ghani', 'f935ab', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i7.5ca6hE4ChE4Czu\">Product details of Saeed Ghani Foot &amp; Hand Cream (180gm)</h2>\r\n<p class=\"html-content detail-content\">N/A</p>\r\n<p class=\"pdp-mod-section-title \"><span style=\"font-size: medium;\"><strong>Specifications of Saeed Ghani Foot &amp; Hand Cream (180gm)</strong></span></p>\r\n<p class=\"key-li\"><span class=\"key-title\">Brand</span></p>\r\n<p class=\"html-content key-value _mce_tagged_br\">Saeed Ghani</p>\r\n<p class=\"key-li\"><span class=\"key-title\">SKU</span></p>\r\n<p class=\"html-content key-value _mce_tagged_br\">2037450_PK-1916677634</p>\r\n<p class=\"box-content\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.5ca6hE4ChE4Czu\"><span class=\"key-title\">What&rsquo;s in the box</span></p>\r\n<p class=\"html-content box-content-html\">1 x Saeed Ghani Foot &amp; Hand Cream (180gm)</p>', 380, '20230714083930_kgmfqc2z.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'saeed-ghani-foot-hand-cream-180gm', 2),
(47, 23, NULL, 8, 'POND´S Light Moisturizers Cream - 75ML', 'More Skin Care from Ponds', '64a84c', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.52e6pmbCpmbCRE\">Product details of POND&acute;S Light Moisturiser Cream - 75ML</h2>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>Lightweight &amp; non-oily formula</li>\r\n<li>Moisturizes dry skin with 24 hour moisture lock</li>\r\n<li>Leaves skin soft with non-oily fresh glow</li>\r\n<li>Spreads easily &amp; absorbs instantly</li>\r\n<li>Ideal for all year-round use</li>\r\n<li>Formula contains vitamin E and can be used for the face, hands, and body</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p data-spm-anchor-id=\"0.0.0.i4.12767463418ezk\"><span>What It Is:</span><br />POND&rsquo;S Light Moisturizer is a light sensorial cream infused with Vitamin E to give a non-oily fresh feel for soft glowing skin.<br />Its lightweight formula absorbs into the skin instantly and makes it ideal for all year-round use, not making the skin feel sticky or oily.<br />It improves the skin&rsquo;s radiance, softness, smoothness &amp; gives a healthy appearance.<br /><span>Skin Type:</span>&nbsp;All Skin Types<br /><span>Instructions for use:</span>&nbsp;Apply the cream gently on your face, hands, and body in circular motion till it is fully absorbed into your skin.<br /><span>Highlighted Ingredients:&nbsp;</span>Vitamin E</p>\r\n</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of POND&acute;S Light Moisturiser Cream - 75ML</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">Ponds</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">315455104_PK-1669826355</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class