(50, 26, NULL, 8, 'SUNLIV Sun Protection Cream Sun Block SPF 60 PA', 'More Skin Care from SUNLIV', '9ef326', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.4d41aUtEaUtEpO\">Product details of SUNLIV Sun Protection Cream Sun Block SPF 60 PA*** Broad Spectrum UVA/UVB Protection Sunblock , Sunscree</h2>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.4d41aUtEaUtEpO\">SunLiv Sun Protection Cream.FEATURES:</li>\r\n<li>??SunLiv gives maximum sunlight protection.??SunLiv is easy to spread &amp; non-greasy. ??SunLiv gives consistent efficacy throughout the day. ??SunLiv added vitamins for skin enrichment.?? SunLiv recommended for sensitive skin.</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p><span><strong>FEATURES:</strong></span></p>\r\n<p><span>??SunLiv gives maximum sunlight protection.</span><span>??SunLiv is easy to spread &amp; non-greasy. </span><span>??SunLiv gives consistent efficacy throughout the day. </span><span>??SunLiv added vitamins for skin enrichment.</span><span>?? SunLiv recommended for sensitive skin.</span></p>\r\n<p><span><strong>ACTIVE INGREDIENTS:</strong></span></p>\r\n<p><span>Octyl methoxycinnamate, Butyl methoxydibenzoylmethane, Octocrylene, Micronized Zincoxide, Titanium dioxide.</span></p>\r\n<p><span><strong>HOW TO APPLY:</strong></span></p>\r\n<p><span>?? SunLiv Cream should be applied on all exposed parts of skin 30 minutes before going out in the sun. A single application may give day long protection but the product should be re applied during prolonged period of sunning, swimming or excessive sweating. </span><span><strong>RECOMMENDED FOR ALL OUTDOOR ACTIVITIES</strong></span><span><strong>EASY AND PLEASANT APPLICATION</strong></span></p>\r\n</div>', 735, '20230714093008_pb0r6xg8.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'sunliv-sun-protection-cream-sun-block-spf-60-pa', 6),
