(55, 30, NULL, 9, 'Garnier Color Naturals - 5 1/2 Creamy Coffee Hair Color', 'More Hair Care from Garnier', '9e4d1a', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.19e6QTC1QTC1R1\">Product details of Garnier Color Naturals - 5 1/2 Creamy Coffee Hair Color</h2>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.19e6QTC1QTC1R1\">- Natural, long lasting and shiny color</li>\r\n<li>- Nourishes as it colors for up to 8 weeks</li>\r\n<li>- 100% grey coverage</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p>&nbsp;</p>\r\n<div>\r\n<div>\r\n<div><span>Enriched with 3 essential oils &ndash; olive, almond and avocado, Garnier Color Naturals leaves your hair looking shiny, silky and nourished. The no ammonia cr&egrave;me formula comes with a superior color lock technology that gives you rich color that lasts up to 8 weeks. Check out the 10 other vibrant Garnier Color Naturals shades that are suited for Pakistani skin tones. All the Garnier Color Naturals hair colors come in an easy to use kit that can be used at your convenience.</span></div>\r\n</div>\r\n</div>\r\n<p><span><strong>HOW TO USE</strong></span></p>\r\n<ul>\r\n<li><span>Perform a skin allergy test hours prior to the hair coloring.</span></li>\r\n<li><span>Wear gloves provided in the box and mix developer and the colorant in a non-metallic bowl in a 1:1 ratio.</span></li>\r\n<li><span>Start at the roots and work your way towards the tips, while dividing the hair into sections.</span></li>\r\n<li><span>Leave it for 30 minutes.</span></li>\r\n<li><span>Rinse with water, apply conditioner and then rinse again.</span></li>\r\n<li><span>Reveal soft, shiny and radiant hair color!</span></li>\r\n</ul>\r\n<span><strong>INGREDIENTS</strong></span>\r\n<p><span>WATER, CETEARYL ALCOHOL, ETHANOLAMINE, AMMONIUM HYDROXIDE, CETEARETH-25, MINERAL OIL, 4-AMINO-M-CRESOL, ASCORBIC ACID, TOCOPHEROL, SODIUM METABISULFITE, HYDROXYBENZOMORPHOLINE, OLIVE FRUIT OIL, POLYQUATERNIUM-22, SUNFLOWER SEED OIL, AVOCADO OIL, ROSEMARY LEAF EXTRACT, EDTA, SWEET ALMOND OIL, HEXADIMETHRINE CHLORIDE, FRAGRANCE (F.I.L C222358 / 3)</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of Garnier Color Naturals - 5 1/2 Creamy Coffee Hair Color</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">Garnier</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">270395986_PK-1483933893</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Hair Type</span>\r\n<div class=\"html-content key-value\">Not Specified</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.19e6QTC1QTC1R1\">1 * Color Naturals 5 1/2 Creamy Coffee</div>\r\n</div>\r\n</div>', 899, '20230714121523_y2gdcbpw.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'garnier-color-naturals-5-12-creamy-coffee-hair-color', 5),
(56, 31, NULL, 9, 'WBM Ultra Lasting Hold Hair Styling Gel For Men (150g)', 'More Hair Care from Wbm', 'b94b83', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.466ej8AYj8AYF8\">Product details of WBM Ultra Lasting Hold Hair Styling Gel For Men (150g)</h2>\r\n<ul>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.466ej8AYj8AYF8\">Hold: This hair gel provides a strong hold that helps keep your hairstyle in place throughout the day. You can use it to create a variety of hairstyles, from a slicked-back look to a messy, textured style.</li>\r\n<li>Shine: The WBM Hair Gel provides a natural-looking shine that gives your hair a healthy, groomed look. It&acute;s not too shiny or greasy, so it won&acute;t leave your hair looking oily or weighed down.</li>\r\n<li>Non-Flaking: The formula of this hair gel is designed to be non-flaking, which means it won&acute;t leave unsightly flakes on your scalp or clothes. It&acute;s a great option for those who want to avoid the embarrassment of flakes.</li>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.466ej8AYj8AYF8\">Easy to Apply: The gel is easy to apply, and can be worked into your hair with your fingers or a comb. It doesn&acute;t require any special techniques or tools, making it a convenient option for those who want a simple hair styling routine.</li>\r\n</ul>', 699, '20230714122350_fqpuk1n2.jpg', 1, 0, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 1, 'wbm-ultra-lasting-hold-hair-styling-gel-for-men-150g', 6),
