(61, 34, NULL, 10, 'Veet Easy Gel Wax Strips for Body and Legs Dry Skin with Aloe Vera and Green Tea Scent 12 Wax Strips ', 'More Bath & Body from VEET', '619505', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i2.4e17SJ2QSJ2Qvr\">Product details of Veet Easy Gel Wax Strips for Body and Legs Dry Skin with Aloe Vera and Green Tea Scent 12 Wax Strips - Pack of 2</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>Veet Wax Strips Dry At 17% Off</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.4e17SJ2QSJ2Qvr\">Veet Cold Wax Strips are clinically proven* to give up to 28 days of smoothness* &amp; leave your skin exfoliated** and moisturised*. The variant for Dry Skin is Specially formulated with Aloe Vera, known for its moisturizing properties, to suit dry skin and fragranced with Green Tea. The gel formula with Easy-Gel&trade;: &bull; Flows around and actively grips the shortest hairs***, not the skin. &bull; Removes the hairs from the root, for up to 28 days of smoothness*. So it gives confidence to achieve great 1st time results, even for those inexperienced with wax strips. Enjoy the pleasant gel texture on the skin, pleasant fragrance and beautiful colour. How to use Veet Cold Wax Strips are clinically proven* to give up to 28 days of smoothness* &amp; leave your skin exfoliated** and moisturised*. The variant for Normal Skin is specially formulated with naturally derived Shea Butter, known for its moisturizing properties and fragranced with Acai Berries. The gel formula with Easy-Gel&trade;: &bull; Flows around and actively grips the shortest hairs***, not the skin. &bull; Removes the hairs from the root, for up to 28 days of smoothness*. So it gives confidence to achieve great 1st time results, even for those inexperienced with wax strips. Enjoy the pleasant gel texture on the skin, pleasant fragrance and beautiful colour. Ingredients Hydrogenated Styrene/Methyl Styrene/Indene Copolymer, Paraffinum Liquidum, Silica, Polyethylene, Pentaerythrityl Tetra-di-t-butylhydroxyhydrocinnamate, Parfum, Aloe Barbadensis Leaf Juice, Citric Acid, Potassium Sorbate, Sodium Benzoate, CI 77891, CI 61565, CI 47000 Wipes: Paraffinum Liquidum, Hexyldecyl Stearate, Parfum, Tocopheryl Acetate, Limonene Precautions &bull; Retain outer pack &bull; Read and follow all precautions and directions before use. &bull; Suitable for use on the legs, arms, underarms and bikini line. &bull; NOT SUITABLE for use on head, face, eyes, nose, ears, around the anus, genitals and nipples or any other body parts. &bull; Do not use on varicose veins, scars, moles, spotty, broken, irritated, sunburnt skin or on skin that has had an adverse reaction to waxes in the past. Always leave 72 hours between hair removal sessions. &bull; Check with your doctor before using if you are on any medication which can affect the skin or if you suffer from any skin related disorder. &bull; Waxing is not suitable for the elderly, diabetics or people taking oral retinoids. &bull; If you have not waxed before we recommend starting by removing hair from the legs. Only when you have experience then progress to the sensitive areas of underarm and bikini line. &bull; Before use, make sure your skin is dry, non-irritated, and free of creams, oils or deodorant. &bull; Before every use, TEST YOUR SKIN REACTION by applying and removing the product to a small part of the area you wish to treat, following the directions for use. If after 24 HOURS there is no adverse reaction, continue to use. &bull; If you experience any smarting/tingling during use, remove the product immediately using the back of a used strip, Perfect Finish wipe or baby oil and then rinse thoroughly with cold water. If a burning sensation persists, seek medical advice. &bull; Do not wax over the same area more than once &bull; Skin may be more sensitive for a short time after use, so avoid scratching. &bull; After use we recommend waiting 24 hours before using anti-perspirant, any other perfumed product, using artificial tanning equipment, swimming or sunbathing. &bull; If you run out of Perfect Finish wipes, you can use baby oil. Don&acute;t use water, soap or alcohol to remove the wax. &bull; KEEP OUT OF REACH OF CHILDREN. &bull; In case of ingestion, seek medical advice immediately and show outer pack. &bull; Avoid contact with eyes. In case of contact with eyes, rinse immediately with plenty of water and seek medical advice. &bull; Store any remaining strips in a cool, dry place. Manufactured in European Union Disclaimers *Based on clinical study **Based on dead skin cells removal *** 1.5mm</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of Veet Easy Gel Wax Strips for Body and Legs Dry Skin with Aloe Vera and Green Tea Scent 12 Wax Strips - Pack of 2</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">VEET</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">118964176_PK-1272382434</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Ideal Usage</span>\r\n<div class=\"html-content key-value\">Not Specified</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Express delivery</span>\r\n<div class=\"html-content key-value\">Karachi</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\">Veet Easy Gel Wax Strips for Body and Legs Dry Skin with Aloe Vera and Green Tea Scent 12 Wax Strips - Pack of 2</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1027, '20230714010913_hj1w64gz.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'veet-easy-gel-wax-strips-for-body-and-legs-dry-skin-with-aloe-vera-and-green-tea-scent-12-wax-strips', 5),
