(67, 28, NULL, 11, ' V-Comb Electric Machine Painless And Chemical Free Multipurpose V-Comb', 'More Hair Care from No Brand', '666b57', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.a8c4CGUDCGUDd4\">Product details of Anti Lice And Nit Eggs Removing V-Comb Electric Machine Painless And Chemical Free Multipurpose V-Comb</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>The V-COMB is an allergen- and chemical-free treatment which eliminates head lice and eggs with the ease of combing the hair. This hygienic and mess-free electric device is able to detect and prevent head lice infestations while providing immediate visible results. With the help of suction power, the head lice and eggs that are combed out of the head are sucked into the capture filter housed within the V-Comb, easily seen through the transparent capture filter chamber. After treatment, the capture filter is removed from the unit and sealed with a lid for hygienic disposal.</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.a8c4CGUDCGUDd4\">ELIMINATES HEAD LICE &amp; EGGS Combing is still the recommended and most effective way of treating infestations. The V-Comb&reg; takes this a step further by using suction power to extract both head lice and eggs into disposable capture filters. ALLERGEN- &amp; CHEMICAL-FREE Chemical- and alcohol-based anti-lice treatments are often too harsh and unpleasant for children. The V-Comb&reg; is completely safe and suitable for the sensitive scalp. DETECTS &amp; PREVENTS INFESTATIONS The V-Comb&reg; can be used as many times as necessary, with its easily replaceable filters, which makes the device ideal for detecting head lice so further infestations are prevented. HYGIENIC &amp; MESS-FREE The V-Comb&reg; comes with a capture filter which traps extracted head lice and eggs during and after treatment. Each filter comes with a lid to prevent re-infestations in and around the home. AS EASY AS COMBING The V-Comb&reg; unit is easy to use and provides immediate feedback and visible results as the user combs through the hair with its transparent LED-illuminated compartment. HIGH QUALITY DESIGN For its superiority in design, performance, and innovation, the V-Comb&reg; was awarded a Good Design Selection. It has also met all necessary standards as monitored by multiple regulatory bodies.</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of Anti Lice And Nit Eggs Removing V-Comb Electric Machine Painless And Chemical Free Multipurpose V-Comb</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">No Brand</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">148402176_PK-1312092228</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Hair Type</span>\r\n<div class=\"html-content key-value\">Not Specified</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\">1 x V Comb</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1600, '20230714015843_4uh5kdq2.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'v-comb-electric-machine-painless-and-chemical-free-multipurpose-v-comb', 5),
