(100, 45, NULL, 37, 'NESTLE NIDO Fortigrow Powder 900g Pouch', 'More Feeding from Nestle Nido', 'c97b5c', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i9.80ad0aDQ0aDQzo\">Product details of NESTLE NIDO Fortigrow Powder 900g Pouch</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>NESTLE NIDO FORTIGROW is especially formulated for school going kids to provide the best nutrition. It is enriched with nutrients which support your childs learning, immunity and growth to make them mind and body ready for school. Give your child the BEST nutrition with NESTL&Eacute; NIDO Fortigrow- Because when it comes to your child, there are no second chances.NESTL&Eacute; NIDO FORTIGROW has learning support nutrients, including iron, zinc, folic acid and vitamin B6 which help contribute in normal cognitive function. NESTL&Eacute; NIDO FORTIGROW is a source of Vitamin C , Iron and zinc which help maintain the normal functioning of your child&acute;s immune system. NESTL&Eacute; NIDO FORTIGROW contains milk protiens which support your childs growth. Preparation, usage and service:Add 3 tablespoons (32.5g) of NESTLE NIDO FORTIGROW to 1 glass (250 ml) of luke warm boiled water and stir well.Not to be used to feed infants below 12 months of age. Storage instructions:Keep in an air tight jar. Use within 3 weeks once opened.Ingredients and allergen information:Milk Solid Non Fat, Milk Fat, Vegetable Fat, Emulsifier, Vitamins and Minerals. Product contains Soya Lecithin</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\"><span data-spm-anchor-id=\"0.0.0.i2.78967463d86pdr\">NESTLE NIDO FORTIGROW is especially formulated for school going kids to provide the best nutrition. It is enriched with nutrients which support your childs learning, immunity and growth to make them mind and body ready for school. Give your child the BEST nutrition with NESTL&Eacute; NIDO Fortigrow- Because when it comes to your child, there are no second chances.NESTL&Eacute; NIDO FORTIGROW has learning support nutrients, including iron, zinc, folic acid and vitamin B6 which help contribute in normal cognitive function.NESTL&Eacute; NIDO FORTIGROW is a source of Vitamin C , Iron and zinc which help maintain the normal functioning of your child&acute;s immune system. NESTL&Eacute; NIDO FORTIGROW contains milk protiens which support your childs growth. Add 3 tablespoons (32.5g) of NESTLE NIDO FORTIGROW to 1 glass (250 ml) of luke warm boiled water and stir well.Not to be used to feed infants below 12 months of age. Keep in an air tight jar. Use within 3 weeks once opened.Milk Solid Non Fat, Milk Fat, Vegetable Fat, Emulsifier, Vitamins and Minerals. Product contains Soya Lecithin</span></div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of NESTLE NIDO Fortigrow Powder 900g Pouch</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">Nestle Nido</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">183772206_PK-1366916172</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">weight</span>\r\n<div class=\"html-content key-value\">990 g</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">volume</span>\r\n<div class=\"html-content key-value\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.80ad0aDQ0aDQzo\">600 ml</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Express delivery</span>\r\n<div class=\"html-content key-value\">Karachi</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Diaper Pack size</span>\r\n<div class=\"html-content key-value\">Not Specified</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-cont