(101, 46, NULL, 37, 'NESTLE LACTOGEN 2 Follow-up Formula Powder 800g', 'More Feeding from Nestle Lactogen', '379ed9', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.3965mg6Ymg6Y49\">Product details of NESTLE LACTOGEN 2 Follow-up Formula Powder 800g</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>Weight: 800g</li>\r\n<li>Follow-up Formula (from 6 months)</li>\r\n<li>Probiotic (L. Comfortis)</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p>Follow-up Formula (from 6 months) Important notice: &ldquo;Breast milk is best for babies and breastfeeding should continue as long as possible. Before you decide to use an infant formula, consult your health professional for advice&rdquo;</p>\r\n</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of NESTLE LACTOGEN 2 Follow-up Formula Powder 800g</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">Nestle Lactogen</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">NE173OTFLAO0NAFAMZ-1836114</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">volume</span>\r\n<div class=\"html-content key-value\">800 ml</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">weight</span>\r\n<div class=\"html-content key-value\">880 g</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Express delivery</span>\r\n<div class=\"html-content key-value\">Karachi</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.3965mg