(102, 47, NULL, 37, 'PediasureTriplesureStrawberry(850Gm)', 'More Feeding from Pediasure', '28f58d', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.7010PIC2PIC2de\">Product details of PediasureTriplesureStrawberry(850Gm)</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>NewTriple Protein complex blended into an Advanced Carbohydrate base</li>\r\n<li>Contains lactobacillus, bifidobacterium and FOS</li>\r\n<li>Enhanced system of essential vitamins and minerals.</li>\r\n<li>Special Lipid Profile and MCTs</li>\r\n<li>NOT FOR CHILDREN WITH GALACTOSEMIA.</li>\r\n<li>NOT FOR PARENTERAL USE.</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p>Between 2-10 years old, a child undergoes rapid physical and cognitive development, which needs to be supported by good nutrition. Ensuring that the child eats a complete, balanced diet then becomes crucial.</p>\r\n<p>With 37 important nutrients, PediaSure gives your child complete and balanced nutrition to help children achieve visible growth in 8 weeks.</p>\r\n<p>Its unique TripleSure System<span>&trade;&nbsp;</span>includes:</p>\r\n<ul>\r\n<li>Protein, calcium, and vitamin D for bone and muscle development</li>\r\n<li>Prebiotics and probiotics to support immunity</li>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.7010PIC2PIC2de\">Essential vitamins and minerals to help support a healthy appetite</li>\r\n</ul>\r\n<p>PediaSure is available in three kid-approved flavors (vanilla, chocolate &amp; strawberry) in both 400g &amp; 850g packs.</p>\r\n<ul>\r\n<li>Delivered stock will have a minimum of 30 days expiry.</li>\r\n<li>No returns will be accepted for items having a minimum expiry of 30 days.</li>\r\n</ul>\r\n</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of PediasureTriplesureStrawberry(850Gm)</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">Pediasure</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">107380141_PK-1255836614</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Express delivery</span>\r\n<div class=\"html-content key-value\">Karachi</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\">1 x PEDIASURE TRIPLESURE (STRAWBERRY) 850GM</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 4500, '20230715015349_u95knpg1.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'pediasuretriplesurestrawberry850gm', 4);
