(106, 28, NULL, 38, 'Baby Diaper Caddy Organizer, Foldable Felt Storage Bag with Multi Pockets', 'More Diapering & Potty from No Brand', '92c654', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i7.3d26fCVkfCVk5C\">Product details of Baby Diaper Caddy Organizer, Foldable Felt Storage Bag with Multi Pockets and Flexible Compartments, Portable Car Travel Organizer for Changing Nappy, Wipes, Newborn Shower Gift</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>?Premium Quality?- This diaper organizer made with high quality felt material, eco-friendly and safe for your baby, Lasting and durable with strong construction to ensure it withstand heavy items, without collapsing or breaking</li>\r\n<li>?Multi-purpose Organizer ?- Portable diaper caddy to carry around the house, sturdy travel car organizer, breast pump storage basket, baby books and toys organizer, pet toys supplies, or even arts and crafts organizer for all your color pens and scrapbooks. You can easily re-purpose this after your baby outgrow their diapers.</li>\r\n<li>?Removable Inserts?- This caddy organizer has 2 removable magic paste dividers help you adjust this diaper caddy to meet your own needs. You can remove the inserts to have a new toy bin or fit in the modular organizer for better organizing compartments.</li>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.3d26fCVkfCVk5C\">?Multiple Compartments and Pockets?&ndash; This diaper tote bag has several side pockets for all baby stuff: baby toys, diapers, baby clothes, wipes, bibs, onesies, cloth diapers, changing pads, medicine, and more. keeping your baby stuff and accessories well organized and accessible</li>\r\n<li>?Large Capacity?- 14.97*9.26*7.1inch/38*23.5*18cm, larger than most caddy organizer, comes with deep compartments, you can easily store all your baby essentials, organ