(172, 28, NULL, 29, 'Square Shape No-Stick Cake Bread Mold Bake ware Carbon Steel Cake Bread Make Pan', 'More Bakeware from No Brand', '648c62', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i7.1e93KbsZKbsZff\">Product details of Square Shape No-Stick Cake Bread Mold Bake ware Carbon Steel Cake Bread Make Pan/Square Cake Mold Tray Pan</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.1e93KbsZKbsZff\">Enjoy versatility in baking with the Rang Nonstick Square Cake Pan. Designed to fit all recipes designed for a round cake pan, it&acute;s also perfect for brownies, bar cookies. Enjoy roasting vegetables, baking cheesy potatoes, throwing together a quick lasagna and so much more in this square baking pan. For cake baking, we recommend having 2 to 3 pans on hand so each layer will bake and rise with the same consistency.</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<div>\r\n<ul>\r\n<li><span>Square Shape No-Stick Cake Bread Mold Bake ware Carbon Steel Cake Bread Make Pan/Square Cake Mold Tray Pan</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of Square Shape No-Stick Cake Bread Mold Bake ware Carbon Steel Cake Bread Make Pan/Square Cake Mold Tray Pan</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">No Brand</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">351519159_PK-1783108785</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Baking Tray Type</span>\r\n<div class=\"html-content key-value\">Baking Tray</div>\r\n</li>\r\n</ul>\r\