ation-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">No Brand</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">359553170_PK-1804016996</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Model</span>\r\n<div class=\"html-content key-value\">samsung gold</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Writing Speed</span>\r\n<div class=\"html-content key-value\">10 MB/s</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Speed Class</span>\r\n<div class=\"html-content key-value\">Class 10</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Memory Card Type</span>\r\n<div class=\"html-content key-value\">Micro SDHC</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\">1 x 64gb Memory Card</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 799, '20230718125520_y2d4q7jf.png', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'samsung-pro-memory-card-64gb-128gb-ultra-fast-full-hd-microsdhc', 1),
(209, 61, NULL, 34, 'BlueWow Mobile Phone Camera Lens Cell Phone Lens Wide Angle Micro Camera ', 'More Lenses from BlueWow', '810584', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i8.5888KusVKusVhx\">Product details of BlueWow Mobile Phone Camera Lens Cell Phone Lens Wide Angle Micro Camera 2 IN 1 Clip Lens Professional Universal Clip Phone Lens SJP-003 For Samsung Huawei iPhone</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc height-limit\">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>1. 0.45XWide Angle Lens: It can help largely expand the field of view and enable you to capture the entire family or a whole team member into one picture.</li>\r\n<li>2. 12.5XMacro Lens: 12.5X macro lens can take clear photos of extreme tiny world, with it the phone camera lens lets you see the tiny world around you more close than ever before!</li>\r\n<li>3. Protect Your Phone: Our camera lens had designed with a soft silicone pad in the place where touched the phone, which can protect the phone from being pinched.</li>\r\n<li>4. Widely Compatibility: Universal clip-on and takedown design keeps the lens kit attached to almost all smartphones and tablets.</li>\r\n<li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.5888KusVKusVhx\">5. Easy to Install: Just screw the needed lens onto the clip and clip on your phone, complete installation only in seconds.</li>\r\n<li>6. Easy to Carry: Pocket carrying case with handy carabiner makes it the ideal companion for carrying on a trip.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', 450, '20230718125928_8r62gmw4.jpg', 1, 0, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 1, 'bluewow-mobile-phone-camera-lens-cell-phone-lens-wide-angle-micro-camera', 2),
