(215, 28, NULL, 35, 'Portable Speakers For Computer Laptop LCD LED Best Sound Speakers System', 'More Audio from No Brand', 'cf8876', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i9.24faadjEadjErw\">Product details of Mini 2.0 Portable Speakers For Computer Laptop LCD LED Best Sound Speakers System.1 Pair Mini Portable USB Wired Computer Speakers Audio Music Player Square Speaker Compact 3.5mm Jack Laptop Computer.</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>Specification Product Name:Speakers USB Cable Length:100 cm Audio Cable Length: 115 cm Frequency Response (Hz):100 - 20KHz Dimensions :65 x 65 x 65 mm Power Supply:USB/DC5V Interface Type: USB Color:As the picture show 1. Lightweight and portable 2. Easy to connect 3. Multi-device compatible 4. Tone is perfect 5. Stylish appearance</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.24faadjEadjErw\">Description 1.One pair of speakers, the laptop USB speakers deliver clear rich and strong sound for your computer. 2.The small size allows the pc speakers to easily sit on your desk. 3.USB Powered and 3.5mm Audio Input,Just plug the USB cable into your device or the wall and plug the 3.5mm jack into your audio device and not need drives. 4.Compatible with laptops,desktop,notebooks, pc, smart phones, tablets, MP3, MP4 and more devices. works with Win and MacOS. 1.Please allow 1-3mm differs due to manual measurement. 2.Due to the different display and different light,the picture may not reflect the actual color of the item.Thanks for your understanding. 1. Interface type: USB 2. Connection method: 3.5MM audio jack 3. Frequency response range: 40Hz-20KHz 4. Output power: 2W 5. Signal-to-noise ratio: &ge;75dB 6. Material: plastic 7. Number of speakers: 2</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of Mini 2.0 Portable Speakers For Computer Laptop LCD LED Best Sound Speakers System.1 Pair Mini Portable USB Wired Computer Speakers Audio Music Player Square Speaker Compact 3.5mm Jack Laptop Computer.</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">No Brand</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">408127631_PK-1957489100</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 469, '20230718015131_Sr67d89h.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'portable-speakers-for-computer-laptop-lcd-led-best-sound-speakers-system', 2),
(216, 28, NULL, 35, 'WS 858 Mic and Hifi Speaker,Voice Changer, Bluetooth Speaker,Portable Speaker', 'More Audio from No Brand', 'cf0526', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i10.1eacOHgkOHgkmM\">Product details of WS 858 Mic and Hifi Speaker,Voice Changer, Bluetooth Speaker,Portable Speaker</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc height-limit\">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul>\r\n<li>Output Power: 5W</li>\r\n<li>Frequency Range: 100Hz~10KHz</li>\r\n<li>Max Sound Pressure Level: &gt;115db 1KHz TDH</li>\r\n<li>utput Power: 5W</li>\r\n<li>Frequency Range: 100Hz~10KHz</li>\r\n<li>Max Sound Pressure Level: &gt;115db 1KHz TDH</li>\r\n<li>Bluetooth Microphone Karaoke 858Wireless Handheld Microphone KTV Karaoke Stereo USB Player Bluetooth MICModel No- WSTER WS-858</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p>Output Power: 5W</p>\r\n<p>Frequency Range: 100Hz~10KHz</p>\r\n<p>Max Sound Pressure Level: &gt;115db 1KHz TDH</p>\r\n<p>utput Power: 5W</p>\r\n<p>Frequency Range: 100Hz~10KHz</p>\r\n<p>Max Sound Pressure Level: &gt;115db 1KHz TDH</p>\r\n<p>Bluetooth Microphone Karaoke 858<br />Wireless Handheld Microphone KTV Karaoke Stereo USB Player Bluetooth MIC<br />Model No- WSTER WS-858</p>\r\n<p data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.1eacOHgkOHgkmM\">Brand new and high quality<br />Portable and durable, lightweight, easy to carry<br />Bluetooth technology for lower energy consumption but more stable connection and faster transmits speed, effective wireless operating distance is up to 10m.<br />Metal shell protective and super bass loss-less sound create a high-quality listening experience.<br />Noise cancellation function wireless capacity microphone, you can enjoy singing wonderful music by yourself.<br />Bluetooth wireless design for connecting to any Bluetooth enabled smart devices.<br />Distortion is less than 0.5 percent, reduce the loss of sound quality effectively.<br />Fashion outdoor bag design, it can be hung on the bike or taken by hands, let you enjoy music all the way.<br />It also can recording with mobile phone, connect the recording wire and open the Karaoke software in the mobile phone, then you can record the song and save it.<br />Suitable for picnic trips, party, family entertainment, singing karaoke, etc..<br />Compatible with Most mobile phones and tablets.<br />Output Power: 5WFrequency Range: 100Hz~10KHzMax Sound Pressure Level: &gt;115db 1KHz TDH</p>\r\n</div>\r\n<div class=\"pdp-mod-specification\">\r\n<h2 class=\"pdp-mod-section-title \">Specifications of WS 858 Mic and Hifi Speaker,Voice Changer, Bluetooth Speaker,Portable Speaker</h2>\r\n<div class=\"pdp-general-features\">\r\n<ul class=\"specification-keys\">\r\n<li class=\"key-li\"><span class=\"key-title\">Brand</span>\r\n<div class=\"html-content key-value\">No Brand</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">SKU</span>\r\n<div class=\"html-content key-value\">135628018_PK-1295838881</div>\r\n</li>\r\n<li class=\"key-li\"><span class=\"key-title\">Model</span>\r\n<div class=\"html-content key-value\">WS 858 Mic and Hifi Speaker,Voice Changer, Bluetooth Speaker,Portable Speaker</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"box-content\"><span class=\"key-title\">What&rsquo;s in the box</span>\r\n<div class=\"html-content box-content-html\">WS 858 Mic and Hifi Speaker,Voice Changer, Bluetooth Speaker,Portable Speaker</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 999, '20230718015518_170k2czt.jpg', 1, 1, 0, NULL, NULL, 0, 0, NULL, NULL, '100', 0, 0, 'ws-858-mic-and-hifi-speakervoice-changer-bluetooth-speakerportable-speaker', 3),
